import { useState } from 'react';
import './App.css';
import Books from './components/Books';
import bookData from './bookData.json';

const BOOKS = bookData;

const App = () => {
  const [books] = useState(BOOKS);

  return (
    <div>
      <h1 className='books'>Books</h1>
      <Books items={books}/>
    </div>
  );
}

export default App;
